import React from 'react';
import './ElementProperties.css';

function ElementProperties({ element, updateElement }) {
  if (!element) return null;

  const handleContentChange = (e) => {
    updateElement(element.id, { content: e.target.value });
  };

  const handleStyleChange = (property, value) => {
    updateElement(element.id, { 
      style: { ...element.style, [property]: value } 
    });
  };

  return (
    <div className="element-properties">
      <h3>Element Properties</h3>

      <div className="property-group">
        <h4>Content</h4>
        {(element.type === 'text' || element.type === 'heading' || element.type === 'button') && (
          <textarea 
            value={element.content} 
            onChange={handleContentChange}
            rows={3}
          />
        )}

        {element.type === 'image' && (
          <input 
            type="text" 
            value={element.content} 
            onChange={handleContentChange}
            placeholder="Image URL"
          />
        )}
      </div>

      <div className="property-group">
        <h4>Typography</h4>
        <div className="property-row">
          <label>Font Size</label>
          <input 
            type="text" 
            value={element.style.fontSize} 
            onChange={(e) => handleStyleChange('fontSize', e.target.value)}
          />
        </div>

        <div className="property-row">
          <label>Color</label>
          <input 
            type="color" 
            value={element.style.color || '#000000'} 
            onChange={(e) => handleStyleChange('color', e.target.value)}
          />
        </div>

        <div className="property-row">
          <label>Font Weight</label>
          <select 
            value={element.style.fontWeight || 'normal'} 
            onChange={(e) => handleStyleChange('fontWeight', e.target.value)}
          >
            <option value="normal">Normal</option>
            <option value="bold">Bold</option>
            <option value="100">100</option>
            <option value="200">200</option>
            <option value="300">300</option>
            <option value="400">400</option>
            <option value="500">500</option>
            <option value="600">600</option>
            <option value="700">700</option>
            <option value="800">800</option>
            <option value="900">900</option>
          </select>
        </div>

        <div className="property-row">
          <label>Text Align</label>
          <select 
            value={element.style.textAlign || 'left'} 
            onChange={(e) => handleStyleChange('textAlign', e.target.value)}
          >
            <option value="left">Left</option>
            <option value="center">Center</option>
            <option value="right">Right</option>
            <option value="justify">Justify</option>
          </select>
        </div>
      </div>

      <div className="property-group">
        <h4>Dimensions</h4>
        <div className="property-row">
          <label>Width</label>
          <input 
            type="text" 
            value={element.style.width || '200px'} 
            onChange={(e) => handleStyleChange('width', e.target.value)}
          />
        </div>

        <div className="property-row">
          <label>Height</label>
          <input 
            type="text" 
            value={element.style.height || 'auto'} 
            onChange={(e) => handleStyleChange('height', e.target.value)}
          />
        </div>
      </div>
    </div>
  );
}

export default ElementProperties;
